import React from 'react';
import './Body.css'
import Item from './item.js'

//Create items for the shop, only need to add name of item and price and it will create a new html object

export default class Body extends React.Component{

  state={
    total: 0
  }

  onChangeTitleHandler = (e, Price) =>{
    console.log(e)
    console.log(Price)
    // const ItemIndex = this.state.Item;
  }
  
  render(){
    return(
        <div className="MainBody">
          <div className="column">
            <Item Item="Apple" Price="1" titleChange={this.onChangeTitleHandler.bind(this, Item.Price)}/>
            <Item Item="Banana" Price="2" titleChange={this.onChangeTitleHandler.bind(this, Item.Price)}/>
            <Item Item="Peach" Price="4" titleChange={this.onChangeTitleHandler.bind(this, Item.Price)}/>
            <Item Item="Lettuce" Price="3" titleChange={this.onChangeTitleHandler.bind(this, Item.Price)}/>
            <Item Item="Celery" Price="2" titleChange={this.onChangeTitleHandler.bind(this, Item.Price)}/>
            <Item Item="Broccoli" Price="2" titleChange={this.onChangeTitleHandler.bind(this, Item.Price)}/>
            <Item Item="Cabbage" Price="5" titleChange={this.onChangeTitleHandler.bind(this, Item.Price)}/>
            <Item Item="Grapes" Price="4" titleChange={this.onChangeTitleHandler.bind(this, Item.Price)}/>
          </div>
          <div className="column">
            <Item Item="Beef" Price="6" titleChange={this.onChangeTitleHandler.bind(this, Item.Price)}/>
            <Item Item="Chicken" Price="5" titleChange={this.onChangeTitleHandler.bind(this, Item.Price)}/>
            <Item Item="Steak" Price="6" titleChange={this.onChangeTitleHandler.bind(this, Item.Price)}/>
            <Item Item="Milk" Price="2" titleChange={this.onChangeTitleHandler.bind(this, Item.Price)}/>
            <Item Item="Tea" Price="2" titleChange={this.onChangeTitleHandler.bind(this, Item.Price)}/>
            <Item Item="Coffee" Price="2" titleChange={this.onChangeTitleHandler.bind(this, Item.Price)}/>
            <Item Item="Flour" Price="5" titleChange={this.onChangeTitleHandler.bind(this, Item.Price)}/>
            <Item Item="Bread" Price="4" titleChange={this.onChangeTitleHandler.bind(this, Item.Price)}/>
          </div>
        </div>
    )
  }
}


